import React from 'react'
import styled from 'styled-components'

const ConetentContainer = ({state}) => {
    return (
        <>
        <Header>
        <div className="project-container">
                    <h2 className="project-title">{state.title}</h2>
                    <h3 className="project-author">{state.artist}</h3>
                    <div className="project-description-container">
                            <div className="project-description" dangerouslySetInnerHTML={{__html: state.description}}>

                        </div>
                    </div>
                </div>



        </Header>
         </>
    )
}

export default ConetentContainer

const Header = styled.header`
    padding: 1rem;

    img {
        width: 100%;
    }
`
